const About = () => {
    return (
        <div className="about">
            <h1>About Us</h1>
            <p>Welcome to our pizza restaurant! We have been serving delicious pizzas since [Year]. Our passion for quality ingredients and authentic recipes sets us apart.</p>
            <p>At our restaurant, we believe in using only the freshest ingredients to create mouthwatering pizzas that our customers love. Our team is dedicated to providing excellent service and a memorable dining experience.</p>
            <p>Join us for a slice of happiness!</p>
        </div>
    );
};

export default About;
